import ScrollToTop from "../../components/Common/ScrollTop";
import React from "react";

const CourseMain = () => {

	const courseData = {
		duration: 10,
		description: "<p>Este curso ofrece una visi贸n buscan actualizar sus habilidades.</p>",
		detail: "<p>Bienvenido al curso de <strong>Iniciaci贸n al Marketing Digital</strong>, un potencial del marketing digital y dar un impulso significativo a tu carrera o negocio.</p>",
		category: [
			"Finances",
			"Trading"
		],
		modules: [
			{
				name: "Inicios bellos",
				content: [
					{
						type: "video",
						title: "Video test 1",
						url: "https://www.youtube.com/watch?v=vXj71r-WrQk&t=789s"
					},
					{
						text: "Se ve toda la data del curso",
						type: "text",
						title: "Test article 1"
					},
					{
						questions: [
							{
								question: "Question 1",
								answers: [
									"11",
									"22",
									"33",
									"44"
								],
								correctAnswer: "22"
							}
						],
						type: "quiz"

					},

				]
			},
			{
				name: "Segunda parte",
				content: [
					{
						type: "video",
						title: "Video test 1",
						url: "https://www.youtube.com/watch?v=vXj71r-WrQk&t=789s"
					},
					{
						text: "Se ve toda la data del curso",
						type: "text",
						title: "Test article 1"
					},
					{
						questions: [
							{
								question: "Question 1",
								answers: [
									"11",
									"22",
									"33",
									"44"
								],
								correctAnswer: "22"
							}
						],
						type: "quiz"

					},

				]
			}
		]
	}



	return (
		<React.Fragment>

			{/* CoursePart Start */}
			{/* Contact Section Start */}
			<div className="rs-about style1 pt-50 pb-50 md-pt-50 md-pb-60 " >
				<div className="container">
					<CourseFlow courseData={courseData} />
				</div>
			</div>
			{/* Contact Section End */}
			{/* CoursePart End */}

			{/* scrolltop-start */}
			<ScrollToTop scrollClassName="scrollup orange-color" />
			{/* scrolltop-end */}
		</React.Fragment>
	);
};


export default CourseMain;
